import React, { useState } from 'react';
import './App.css';
import FHIRNLPInterface from './FHIRNLPInterface.js';



function App() {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState(null);

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: send query to backend
    console.log('Submitting:', query);
    // You can later replace this with a fetch() call
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h1>FHIR NLP Interface</h1>
      <p>Type a query like "Show me all diabetic patients over 50"</p>

      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Enter a patient query..."
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          style={{ width: '300px', padding: '0.5rem', marginRight: '1rem' }}
        />
        <button type="submit">Submit</button>
      </form>

      {results && (
        <pre>{JSON.stringify(results, null, 2)}</pre>
      )}
    </div>
  );
}

export default App;
